  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112336 includes biological,
  chemical, discrete sample, physical and profile data collected from KEIFU MARU in
  the North Pacific Ocean and South Pacific Ocean from 2008-06-17 to 2008-08-03 and
  retrieved during cruise 49FA20080617, KS08-06 Leg.1 and PACIFICA_49FA20080617. These
  data include ALKALINITY, AMMONIUM, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), CHLOROPHYLL A, DELTA CARBON-13, DISSOLVED INORGANIC CARBON, DISSOLVED
  ORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRATE + NITRITE
  CONTENT (CONCENTRATION), NITRITE, PHAEOPHYTIN, PHOSPHATE, Potential temperature
  (theta), SALINITY, SIGMA-THETA, SILICATE, TOTAL PHOSPHORUS, WATER TEMPERATURE and
  pH. The instruments used to collect these data include CTD, Coulometer for DIC measurement
  and bottle. These data were collected by Masao Ishii of Meteorological Research
  Institute; Geochemical Research Department and Takahiro Segawa [affiliation unknown]
  as part of the PACIFICA_49FA20080617 data set.nnPACIFICA (PACIFic ocean Interior
  CArbon) was an international collaborative project for the data synthesis of ocean
  interior carbon and its related parameters in the Pacific Ocean. The North Pacific
  Marine Science Organization (PICES), Section of Carbon and Climate (S-CC) supported
  the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
